import React from 'react';

const MenuAmojs = () => {
  return (
    <div className="menu">
      <ul className="navbar-nav">
        <li className="nav-item">
          <a className="nav-link active" href="#">Por hacer</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">En progreso</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">Por cobrar</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">Para facturar</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="#">Facturado</a>
        </li>
      </ul>
    </div>
  );
};

export default MenuAmojs;
